import React, { Component } from 'react';

import Image from '../../../helper/Image';
import HttpRequest from '../../../helper/HttpRequest';

interface RecentState {
    images: Image[];
    error: boolean;
    loading: boolean;
    errorMessage: string;
    nbImagesLoaded: number;
}

const NB_IMAGE_PER_FETCH: number = 5;

class Recent extends Component {
    state = {
        images: [],
        error: false,
        loading: true,
        errorMessage: '',
        nbImagesLoaded: 0,
    }

    setError(errorMessage: string) {
        this.setState({ error: true, loading: false });
    }

    handleFetchError(data: any | null): boolean {
        if (!data) {
            this.setError('Something unexptected happened. Please try again later.');
            return true;
        }
        if (data.error) {
            this.setError(data.error.message);
            return true;
        }
        return false;
    }

    fetchImages(offset: number) {
        try {
            const data: any | null = HttpRequest.getData(`http://localhost:8000/images/${offset}/${NB_IMAGE_PER_FETCH}`);
        } catch (e) {
            this.setError('Something unexpected happened. Try again later.')
        }
    }

    componentDidMount() {
        this.fetchImages(0);
    }

    render() {
        return (
            <p>Recent</p>
        )
    }
}

export default Recent;
